define({"topics" : [{"title":"Enrolling Windows file shares","shortdesc":"\n                  <p class=\"shortdesc\">To enroll Windows file shares, you use a utility called Resource Path Discovery             (<span class=\"ph filepath\">ResourcePathDiscovery.exe</span>). \n                  </p>\n               ","href":"enrolling_windows_file_shares.html","attributes": {"data-id":"enrolling_windows_file_shares",},"menu": {"hasChildren":false,},"tocID":"enrolling_windows_file_shares-d66e1223","topics":[]},{"title":"Enrolling Linux file servers","shortdesc":"\n                  <p class=\"shortdesc\">For Linux servers, there are two remaining steps in the enrollment process. These         steps must be performed after Windows\n                     file shares are enrolled.\n                  </p>\n               ","href":"enrolling_linux_file_servers.html","attributes": {"data-id":"enrolling_linux_file_servers",},"menu": {"hasChildren":false,},"tocID":"enrolling_linux_file_servers-d66e1237","topics":[]},{"title":"Microsoft Distributed File System","shortdesc":"\n                  <p class=\"shortdesc\">Microsoft Distributed File System, or DFS, aggregates Windows file share names into a         single machine or domain name\n                     with links to various physical shares.\n                  </p>\n               ","href":"microsoft_distributed_file_system.html","attributes": {"data-id":"microsoft_distributed_file_system",},"menu": {"hasChildren":false,},"tocID":"microsoft_distributed_file_system-d66e1248","topics":[]}]});